Components
Sometimes called presentational or dumb components are components that only render markup based on their props.
They work like pure functions and thus are easy to test and maintain.
We use the Atomic Design pattern to organise and compose our presentational components.
We leverage Storybook when developing presentational components.
Write tests!
The directory of a presentational component looks like this:
* ComponentName
- * index.ts
- * ComponentName.tsx
- * ComponentName.test.tsx
- * ComponentName.story.tsx
- * _ComponentName.scss
